import React, { Component } from 'react'

class TransactionList extends Component {
state = {
    bAccountNo :'',
    iFSC : '',
    bName :'',
    amount :''
}

handleInputChange = e => {
    this.setState([
        [e.target.name] , e.target.value
    ])
}

    render() {
        return (
            <form autoComplete="off">
                <input name="AccuntNo" placeholder="A/C No." value={this.state.bAccountNo} onChange={this.handleInputChange} />
            </form>
        )
    }
}

export default TransactionList
